import React, { Component } from 'react'
import { Route, Switch } from 'react-router-dom';

import About from './components/About'

export default class Home extends Component {
  render() {
    return (
      <main>
        <h1>funcionando</h1>
        <Switch>
          <Route path="/about" Component={ About } />
        </Switch>
      </main>
    )
  }
}
